import React from "react";
import styled from "styled-components";
import phoneShop from "../assets/projects/phone-shop.png";
import journey from "../assets/projects/journey.png";
import netflix from "../assets/projects/netflix.png";
import huddle from "../assets/projects/huddle.avi";
import ham from "../assets/projects/theHam.avi";
import avarage from "../assets/projects/avarage.avi";

const Projects = () => {
  return (
    <ProjectsContainer>
      <h2>Some Example Projects</h2>
      <div>
        <h3>HTML , CSS ,JS, Jquery , Bootstrap </h3>
        <div>
          <img src={phoneShop} alt="" />
          <img src={journey} alt="" />
          <img src={netflix} alt="" />
          <video loop autoPlay  src={huddle} type="video/mp4" >
          </video>
        </div>
      </div>
    </ProjectsContainer>
  );
};

export default Projects;

const ProjectsContainer = styled.div`

img{
    width: 350px;
    margin: 15px;
    height: 200px;
    object-fit: cover;

}
`;
